import * as React from "react";
import Header from "../components/Header";
import { withRouter } from "next/router";

class User extends React.Component {
  constructor(props) {
    super(props);
  }

  /*
    Get the data needed to fill in the page
    */
  getProfileData() {}

  render() {
    return (
      <div>
        <Header />
        this is a user page woohoo
      </div>
    );
  }
}

export default User;
